import React from 'react';
import img from '../src/images/hero.svg';

const Home = () => {
  return (
    <>
      <section>
        <div className='container-fluid'>
          <div className='row'>
            <div className='col-10 mx-auto d-flex'>
              <div className='col-6 hero_text pt-3 d-flex justify-content-center align-items-start flex-column text-capitalize'>
                <h1>
                  Grow Your Business With <strong>Ritam Rahman</strong>
                </h1>
                <br />
                <p>I am a professional Web developer</p>
                <div className='hero_btn'>
                  <a href='#'>Get Started Now</a>
                </div>
              </div>
              <div className='col-6 hero_img'>
                <img src={img} alt='hero' className='img-fluid' />
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Home;
